function getTimer(length, checkInterval, callable) {
    let len = length;
    let interval = checkInterval;

    let startTime;
    let endTime;
    let now;

    let func = callable;

    let loopIndex;

    let reference = {
        reload: function () {
            now = (new Date).getTime();
            console.log(new Date(now));
        },
        loop: function () {
            reference.reload();
            if (endTime===undefined){
                console.error('call by method of set.');
            }else{
                if (now < endTime) {
                    loopIndex = setTimeout(reference.loop, interval);
                }else{
                    console.log('executed');
                    func();
                }
            }
        },
        set: function () {
            startTime = (new Date).getTime();
            endTime = startTime + len;
            this.loop();
        },
        getStartTime: function(){
            return startTime;
        },
        getRemainingTime: function(){
            return now - startTime
        }
    };
    return reference;
}
function getSingleBell() {
    let single_bell = '';
    return {
        ring: function () {
            let sb_sound = new Audio("data:audio/wav;base64," + single_bell);
            sb_sound.play();
        }
    }
}
function getDoubleBell() {
    let double_bell = '';
    return {
        ring: function () {
            let db_sound = new Audio("data:audio/wav;base64," + double_bell);
            db_sound.play();
        }
    }
}

function setTwoTimers(singleMinutes,doubleMinutes) {
    let singleBell = getSingleBell();
    let doubleBell = getDoubleBell();
    let timerSingle = getTimer(1000 * 60 * singleMinutes, 1000, (function(){singleBell.ring();}));
    let timerDouble = getTimer(1000 * 60 * doubleMinutes, 1000, (function(){doubleBell.ring();}));
    timerSingle.set();
    timerDouble.set();
}
/**
 * @param {jQuery} $form
 */
function attachBellEvent($form){
    let $total=$form.find("input[title='total']");
    let $interim=$form.find("input[title='interim']");
    let $button=$form.find("input[type='button']");

    $form.submit(function(e){e.preventDefault();});
    $button.click(function(){
       let totalInterval=parseInt($total.val());
       let interimInterval=parseInt($interim.val());
       if(interimInterval>totalInterval){
           alert('interim is set longer than total');
       }else{
           setTwoTimers(interimInterval,totalInterval);
       }
    });
}

attachBellEvent($('#presentation'));
attachBellEvent($('#questionAnswer'));